  false,\n\t\"url\": null,\n\t\"notes\": \"Multibeam data will be collected 24 hours
  a day and XBT casts will be conducted at an interval defined by prevailing oceanographic
  conditions, but not to exceed 6 hours.  Additionally, EK60 single beam and sub-bottom
  profile data will be collected 24 hours per day. Data will only be collected in
  foreign waters where clearance has been granted. If no permit was obtained, all
  data collection systems will be shut down in those foreign waters. All multibeam
  data will be fully processed according to standard onboard procedures.\",\n\t\"owner_org\":
